DELIMITER $$
CREATE TRIGGER `after_insert_instalacion` AFTER INSERT ON `instalacion` FOR EACH ROW BEGIN
    DECLARE hora_actual TIME;
    DECLARE hora_fin TIME;
    DECLARE intervalo INT;

    
    IF NEW.tipo = 'Pista de Padel' THEN
        SET intervalo = 90;
    ELSEIF NEW.tipo = 'Deportiva' THEN
        SET intervalo = 120;
    ELSEIF NEW.tipo = 'Recreativa' THEN
        
        INSERT INTO horarios (id_instalacion, hora_inicio, hora_fin, disponible)
        VALUES (NEW.id, NEW.hora_ini, NEW.hora_fin, 1);
        
    ELSE
        
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Tipo de instalación no reconocido';
        
    END IF;

    
    IF NEW.tipo IN ('Pista de Padel', 'Deportiva') THEN
        
        SET hora_actual = NEW.hora_ini;

        
        WHILE hora_actual < NEW.hora_fin DO
            
            SET hora_fin = ADDTIME(hora_actual, SEC_TO_TIME(intervalo * 60));

            
            INSERT INTO horarios (id_instalacion, hora_inicio, hora_fin, disponible)
            VALUES (NEW.id, hora_actual, hora_fin, 1);

            
            SET hora_actual = hora_fin;
        END WHILE;
    END IF;

END
$$
DELIMITER ;

