DELIMITER $$
CREATE TRIGGER `socio_AFTER_DELETE` AFTER DELETE ON `socio` FOR EACH ROW BEGIN
    UPDATE familia
    SET numero_miembros = numero_miembros - 1
    WHERE num_familia = OLD.num_familia;

    IF (SELECT COUNT(*) FROM socio WHERE num_familia = OLD.num_familia) = 0 THEN
        DELETE FROM familia
        WHERE num_familia = OLD.num_familia;
    END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `socio_AFTER_INSERT` AFTER INSERT ON `socio` FOR EACH ROW BEGIN
    UPDATE familia
    SET numero_miembros = numero_miembros + 1
    WHERE num_familia = NEW.num_familia;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `socio_before_insert` BEFORE INSERT ON `socio` FOR EACH ROW BEGIN
    DECLARE total_socios INT DEFAULT 0;
    DECLARE familia_existente INT DEFAULT 0;
    DECLARE nuevo_id_socio INT DEFAULT 0;
    DECLARE nuevo_numero_socio VARCHAR(10);

    SELECT COUNT(*) INTO familia_existente
    FROM familia
    WHERE num_familia = NEW.num_familia;

    IF familia_existente = 0 THEN
        INSERT INTO familia (num_familia, nombre_titular, apellidos_titular, id_empleado)
        VALUES (NEW.num_familia, NEW.nombre, NEW.apellidos, NEW.id_empleado);
        
        SET NEW.titularidad = 'TITULAR';
    ELSE
        SELECT COUNT(*) INTO total_socios
        FROM socio
        WHERE num_familia = NEW.num_familia AND titularidad = 'TITULAR';

        IF total_socios = 0 THEN
            SET NEW.titularidad = 'TITULAR';
        ELSE
            SET NEW.titularidad = 'NORMAL';
        END IF;
    END IF;

   
    SELECT IFNULL(MAX(CAST(id_socio AS UNSIGNED)), 0) + 1 INTO nuevo_id_socio
    FROM socio
    WHERE num_familia = NEW.num_familia;

    SET NEW.id_socio = LPAD(nuevo_id_socio, 2, '0');
    
    SET nuevo_numero_socio = CONCAT(NEW.num_familia, '/', NEW.id_socio);
    SET NEW.numero_socio = nuevo_numero_socio;

    IF NEW.titularidad = 'TITULAR' THEN
        UPDATE familia
        SET nombre_titular = NEW.nombre, apellidos_titular = NEW.apellidos
        WHERE num_familia = NEW.num_familia;
    END IF;
END
$$
DELIMITER ;

